import { useState, useEffect } from "react";

function App() {
  const [people, setPeople] = useState([]);

  useEffect(async () => {
    const resp = await fetch("https://www.swapi.tech/api/people/");

    const data = await resp.json();

    setPeople(data);
  }, []);
  return (
    <div>
      <h1>SWAPI</h1>
    </div>
  );
}

export default App;
